import React from 'react';
import { Link } from "react-router-dom";

export default function Dashboard() {
  return(
    <div className='General'>
        <div className='General_head'>
            <h1 className='General_head_name'>Name of the game</h1>
            <Link to="/leaderboard">
                <h2>leaderboard</h2>
            </Link>

            <Link to="/account">
                <h2>User_account</h2>
            </Link>
        </div>
        <div>


        </div>
    </div>
  );
}
